import "./App.css";
import React from "react";
import About from "./components/About";
import Skills from "./components/Skills";
import Navbar from "./components/Navbar";


function App() {
  return (
    <main className="text-gray-400 bg-gray-900 body-font">
    <Navbar />
    <About />
    <Skills />
    <Contact />
  </main>
  );
}

export default App;
